import React, { Component } from 'react';
import { BrowserRouter as Router, Route,Switch, Redirect} from 'react-router-dom'
import Patient from './patient/patientmain';
import Doctor from './Doctor/Doctormain';


class Homepage extends Component {
  render() {
      return (
         <BrowserRouter>
          <div className='container-fluid'>
              <div className='row'>
                  <ul className='sidebar-submenu '>
                      <li>
                          <NavLink to='/patient' activeClassName='active'>Patient</NavLink>
                      </li>
                      <li>
                          <NavLink to='/doctor' activeClassName='active'>Doctor</NavLink>
                      </li>
                  </ul>
                  <div className='col-md-10 admin-content'>
                      <Switch>
                          <Route exact path='patient' component={Patient} />
                          <Route exact path='/doctor' component={Doctor} />
                      </Switch>
                  </div>
              </div>
          </div>
         </BrowserRouter>
      );
  }
}







































